import React from "react";

const AddUser = props => {
    const addUserHandler =(event) =>{
        event.preventDefault();
    }
    return (
        <form onsubmit={addUserHandler}>
            <label>Username</label>
            <input type="text"/>
            <label>Age (Years)</label>
            <input type="number"/>
            <button type="submit"> Add User</button>
        </form>
    )
}

export default AddUser;
